import React from 'react';
import ReactDOM from 'react-dom';
import './styles.css';
import profileIcon from './Images/profileIcon.png';
import shoppingCartIcon from './Images/shoppingCart.png';
import shoppingIconIcon from './Images/shoppingIcon.png';

class NavBar extends React.Component {
    render() {
      return (
        <header>
            <nav>
                <ul>
                    <li style={{listStyleType: "none"}}><a className="nav-link" href="#">Home</a></li>
                    <li><a className="nav-link" href="nav-pages/about-me.html">About Me</a></li>
                    <li><a className="nav-link" href="#stickers">Stickers</a></li>
                    <li><a className="nav-link" href="nav-pages/custom-order.html">Custom Order</a></li>
                    <li><a className="nav-link" href="nav-pages/contact-me.html">Contact Me</a></li>
                    <li className="nav-images-li">
                        <ul>
                            <li><a href="icon-pages/login-profile.html" className="nav-image"><img style={{width: "3vw", marginTop: "7px"}} src={profileIcon} alt="profile icon"></img></a></li>
                            <li><a href="icon-pages/login-profile.html" className="nav-image"><img style={{width: "3vw"}} src={shoppingCartIcon} alt="shopping cart icon icon"></img></a></li>
                            <li><a href="icon-pages/login-profile.html" className="nav-image"><img style={{width: "3vw", marginTop: "7px"}} src={shoppingIconIcon} alt="shopping icon"></img></a></li>
                        </ul>
                    </li>
                </ul>
            </nav>
        </header>
      );
    }
}

export default NavBar;
